import Link from 'next/link';

const Navbar = () => (
    
        <nav>
            
            <Link href="/">Home</Link>
            <Link href="/about.js"><a>About</a></Link>
            <Link href="/projects.js"> <a>Projects</a> </Link>
            <Link href="/contact.js"><a>Contact</a>  </Link>
            
        </nav>

)
export default Navbar;
